		var timeCal_time = new Date();
		
		var diff = timeCal_time.getTime() - lev1_start_time.getTime();
		var msec = diff;
		var hh = Math.floor(msec / 1000 / 60 / 60);
		msec -= hh * 1000 * 60 * 60;
		var mm = Math.floor(msec / 1000 / 60);
