		{
			resetTimer();
			blockAll();
			clearInterval(timeCal);
			root.gotoAndPlay(3);
		}
		
		function prev()
		{
			resetTimer();
			blockAll();
			clearInterval(timeCal);
			root.gotoAndPlay(this.currentFrame-1);//feeling lazy. Use a keyframe label sometime please instead of hardcoding it.
		}
		
